import React from "react";


class FailMessage extends React.Component{
    render(){
        return(
            <div className="message-wrapper">
                <p>
                    この度は弊社の選考に応募いただきありがとうございました。
                    誠に残念ながら、選考に関しまして貴意に添い兼ねる結果となりました。
                    何卒ご容赦くださるようお願いします。
                </p>
            </div>
        )
    }
}

export default FailMessage;
